package entity

import (
	"testing"
	"time"

	"github.com/asaskevich/govalidator"
	."github.com/onsi/gomega"
)

func TestPaymentcorrect(t *testing.T) {
	g := NewGomegaWithT(t)

	currentTime := time.Now()
		currentTime.Format("2006-1-2 15:4:5")

		
	payment := Payment{
		Evidence: 		"data:image/jpeg;base64,",
		PaymentTime:	currentTime,

	}

	ok, err := govalidator.ValidateStruct(payment)

	g.Expect(ok).To(BeTrue())

	g.Expect(err).To(BeNil())

}

func TestEvidenceNotnull(t *testing.T) {
	g := NewGomegaWithT(t)

	currentTime := time.Now()
		currentTime.Format("2006-1-2 15:4:5")

	payment := Payment{
		Evidence: 		"",//
		PaymentTime:	currentTime,

	}
	//  govalidator
	ok, err := govalidator.ValidateStruct(payment)

	// ok  true  error 
	g.Expect(ok).ToNot(BeTrue())

	// err  nil  error 
	g.Expect(err).ToNot(BeNil())

	// err.Error  error message 
	g.Expect(err.Error()).To(Equal("Evidence cannot be blank"))

}


func TestPaymentTimeIncorrect(t *testing.T) {
	g := NewGomegaWithT(t)

	currentTime := time.Now()
		currentTime.Format("2006-1-2 15:4:5")

	payment := Payment{
		Evidence: 		"data:image/jpeg;base64,",
		PaymentTime:	time.Now().Add(2 * time.Minute), // 
	}
	//  govalidator
	ok, err := govalidator.ValidateStruct(payment)

	// ok  true  error 
	g.Expect(ok).ToNot(BeTrue())

	// err  nil  error 
	g.Expect(err).ToNot(BeNil())

	// err.Error  error message 
	g.Expect(err.Error()).To(Equal("PaymentTime not past"))

}
